import React from "react";
import Comman from "./Comman";
import web from "../src/images/web1.jpg";


export const Home =()=>{
    return(
        <>
            <section>
               <img src={web} className=""  alt="not shown" >
                   <h1>why choose us</h1>
                   </img>
                   <h2 className="my-3">We Co-Partner to build Solutions for the Future.
                    our high-performance teams engage themselves in your project
                     to deliver the business goals on time and within financial resources. 
                   The emphasis to build relationships based on mutual trust and respect 
                   helps achieve the desired results.</h2>
                   <div className="my-3">
                   <a href="" className=" btn-get-started ">get started</a>
                    
                   </div>
                   
                   <div className="col-lg-6 order-1 order-lg-2 header-img ">
                   <img src={web} className="img-fluid animated" alt="not shown" />
                   </div>
                  
           </section>
        </>
    )

};

export default Home;
